  `id_programacion` int(11) DEFAULT NULL,
  `no_entrega` int(11) DEFAULT NULL,
  `no_id_eps` varchar(255) DEFAULT NULL,
  `no_id_proveedor` varchar(255) DEFAULT NULL,
  `no_rescripcion` varchar(255) DEFAULT NULL,
  `no_sub_entrega` int(11) DEFAULT NULL,
  `numero_id_paciente` varchar(255) DEFAULT NULL,
  `reportado_anulado` bit(1) DEFAULT NULL,
