  `tipo_id_proveedor` varchar(255) DEFAULT NULL,
  `tipo_tec` varchar(255) DEFAULT NULL,
  `id_consulta_entrega` int(11) DEFAULT NULL,
  `id_consulta_reporte_entrega` int(11) DEFAULT NULL,
  `id_entrega` int(11) DEFAULT NULL,
  `id_reporte_entrega` int(11) DEFAULT NULL,
  `numdoc_acompanante` varchar(255) DEFAULT NULL,
  `tipodoc_acompanante` varchar(255) DEFAULT NULL,
  `valor_entregado` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

CREATE TABLE `entrega` (
